import React from "react";

function SignupLoginPage() {
  return (
    <div
      style={{
        height: "100vh",
        width: "100vw",
        backgroundColor: "#F2F2F2",
        display: "flex",
      }}
    >
      <div
        style={{
          backgroundColor: "#FFFFFF",
          height: "78vh",
          width: "86vw",
          marginLeft: "7vw",
          marginRight: "7vw",
          marginTop: "10vh",
          marginBottom: "12vh",
          borderRadius: "15px",
          boxShadow: "0px 0px 30px 0px #00000026",
        }}
      >
        <p
          style={{
            height: "15%",
            width: "100%",
            marginTop: "5vh",
            fontSize: "40px",
            fontWeight: "600",
            textAlign: "center",
            color:"#474444",
            backgroundColor: "pink",
          }}
        >
          QUIZZIE
        </p>
        <p
          style={{
            height: "13%",
            width: "100%",
            marginTop: "5vh",
            fontSize: "25px",
            fontWeight: "600",
            textAlign: "center",
            color:"#474444",
            backgroundColor: "pink",
          }}
        >
          Sign up Login
        </p>
      </div>
    </div>
  );
}

export default SignupLoginPage;
